import React from 'react'

import { Page } from './styles'

export default function Lista() {
    return (
        <Page>
            {
                Lista.map((item) => {
                    return (
                        <Item>
                            <ItemText>{item.task} </ItemText>
                        </Item>
                    )
                })
            }
        </Page>
    )
}
